import React from 'react';

const nodeColors = {
  Customer: '#4CAF50',
  'Counter-Party': '#2196F3',
  Business: '#FFC107',
  Transfer: '#9C27B0',
  BillPay: '#FF5722',
};

const BaseNode = ({ type, color, size = '60px', fontSize = '10px' }) => (
  <div
    className={`custom-node ${type.toLowerCase()}-node`}
    style={{
      width: size,
      height: size,
      borderRadius: '50%',
      backgroundColor: color,
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      color: 'white',
      fontWeight: 'bold',
      fontSize: fontSize
    }}
  >
    {type}
  </div>
);

const TransactionNode = ({ type, color }) => (
  <div
    className={`custom-node ${type.toLowerCase()}-node`}
    style={{
      width: '80px',
      height: '40px',
      borderRadius: '20px',
      backgroundColor: color,
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      color: 'white',
      fontWeight: 'bold',
      fontSize: '10px'
    }}
  >
    {type}
  </div>
);

const nodeTypes = {
  Customer: ({ data }) => (
    <BaseNode type="Customer" color={nodeColors.Customer} />
  ),
  'Counter-Party': ({ data }) => (
    <BaseNode type="Counter-Party" color={nodeColors['Counter-Party']} />
  ),
  Business: ({ data }) => (
    <BaseNode type="Business" color={nodeColors.Business} />
  ),
  Transfer: ({ data }) => (
    <TransactionNode type="Transfer" color={nodeColors.Transfer} />
  ),
  BillPay: ({ data }) => (
    <TransactionNode type="BillPay" color={nodeColors.BillPay} />
  ),
  customNode: ({ data }) => {
    console.log("Unhandled node type:", data.type);
    return (
      <BaseNode 
        type={data.type || 'Unknown'} 
        color={nodeColors[data.type] || '#999'}
      />
    );
  },
};

export default nodeTypes;
